style.css:
@-moz-document domain("startpage.com") {
html, body, section, .video-filter-duration__options, .video-filter-type__options, .news-filter-time__options, .images-filter-color__options, .images-filter-type__options, .images-filter-size__options, .search-filter-place__options, .search-filter-time__options, .ig-gl #expanded-image-section, .hamburger-menu .hamburger-drawer, .hamburger-menu .hamburger-drawer__header, .search-suggestions, .search-suggestions__list
{
	background: #1f1f1f url(data:image/png;base64,);
	color: #ccc;
}

.inline-nav-menu__link, .hero-search__learn-more, .w-gl__result, .vo-sp__description, .cn-bg .description, .ig-gl #expanded-image-section__size, .ig-gl #expanded-image-section__image-site-anonymous-view-url, .hero-search__tagline, .search-suggestions__list, .list-flat
{
	color: #ccc;
}

.cn-bg .second-line-container .date, .footer__ul a, .ig-gl #expanded-image-section__title, .search-form__input, #query
{
	color: #fff;
}

.header__container, .footer__container, .search-form__q, .search-form__form, .footer, .header__content--content, .header__content, .header__navigation, .column--main__content .card, .settings-page__form-action, .boxcontainer, .search-suggestions__item:hover
{
	background-color: #1f1f1f;
}

a:hover, .hero-search__learn-more-trigger:hover, .navigation-links a:hover, .header .menu-container .menu-link:hover, .inline-nav-menu__link__post-link:hover, .search-filter-time__dropdown:hover, .search-filter-place__dropdown:hover, .search-filters-toolbar__advanced:hover, .w-gl__label, .vo-sp__title:hover, .vo-sp__metadata:hover, .images-filter-size__dropdown:hover, .images-filter-color__dropdown:hover, .images-filter-type__dropdown:hover, .video-filter-type__dropdown:hover, .video-filter-duration__dropdown:hover, .video-filter-duration__options .filter-button:hover, .video-filter-type__options .filter-button:hover, .news-filter-time__dropdown:hover, .news-filter-time__options, .news-filter-time__options .filter-button:hover, .search-filter-time__dropdown:hover, .search-filter-place__dropdown:hover, .images-filter-color__options .filter-button:hover, .images-filter-type__options .filter-button:hover, .images-filter-size__options .filter-button:hover, .search-filter-place__options .filter-button:hover, .search-filter-time__options .filter-button:hover, .hamburger-menu .hamburger-drawer a:hover, .search-suggestions__item, .search-suggestions__item:hover
{
	color: #fe9;
}

a, button, .label, .burger-menu__footer-links a, .navigation-links a, .hero-search__tagline em, .hero-search__learn-more-trigger, .text-block__subtitle, .block--light h2, .block--white h2, .w-gl__result-title, .inline-nav-menu__link__active, .header .menu-container .menu-link, .vo-sp__title, .cn-bg .article .title, .images-filter-size__dropdown, .images-filter-color__dropdown, .images-filter-type__dropdown, .video-filter-type__dropdown, .video-filter-duration__dropdown, .video-filter-duration__options .filter-button, .video-filter-type__options .filter-button, .news-filter-time__options .filter-button, .news-filter-time__dropdown, .search-filter-time__dropdown, .search-filter-place__dropdown, .search-filters-toolbar__advanced, .images-filter-color__options .filter-button, .images-filter-type__options .filter-button, .images-filter-size__options .filter-button, .search-filter-place__options .filter-button, .search-filter-time__options .filter-button, .select__label, .header__content--content h1, .hamburger-menu .hamburger-drawer a, .search-suggestions__item, .search-suggestions__item
{
	color: #da3;
}

.inline-nav-menu__link__active, .inline-nav-menu__container
{
	border-bottom-color: #da3;
}

.w-gl__result-url, .w-gl__anonymous-view-url, .vo-sp__metadata, .cn-bg .second-line-container .source, .cn-bg .second-line-container .anonymous-view-url
{
	color: #9fa;
}

.addon__popup, .addon__popup_bg-top, path, #adBlock, .ay-gl-tp, .inline-nav-menu__mask-right, .inline-nav-menu__mask-left, .hero-search__learn-more-separator, .hero-search__learn-more, #more-content, .home-footer__top
{
	display: none;
}

.pagination .num--active, .images-filter-size__options__rightrail__button, .sp-gl__container
{
	background-color: #da3;
	color: #1f1f1f;
}

.inline-nav-menu__link__post-link:hover
{
	border-bottom-color: #da3;
}

.inline-nav-menu__link__post-link:hover
{
	border-bottom-color: #fe9;
}

.inline-nav-menu__link:hover
{
	color: #fe9;
}

.search-form__form
{
	color: #fff;
	border-radius: 0;
	box-shadow: none;
	border: 0px;
}

.search-form__q, input, select, .images-filter-size__options__rightrail__select, .text-input--horizontal .text-input__element
{
	color: #fff;
	background-color: #111;
	border: 1px solid #666
}

.search-form__clear-button, .pagination--desktop .desktop-arrow, .video-filter-type__dropdown__arrow, .images-filter-size__dropdown__arrow, .close-drawer-button, .hamburger-menu .hamburger-button
{
	filter: invert(100%);
}

.search-form .highlight
{
	border: none;
	box-shadow: 0px 0px 15px 0px #fe9;
}

.sp-gl__result
{
	color: darkred;
}

.inline-nav-menu
{
	position: static !important
}

.search-form__button .ico-wrapper
{
	margin-left: 3px;
	height: 40px;
	width: 40px;
	border-radius: 10%;
	border: solid 1px #aaa;
}

.home-footer__bottom, .home-footer
{
	padding: 0px;
}

.header
{
	border-bottom: 1px solid #ebecf7;
}

.a11y-sr-only, input.search-form__input
{
	border-radius: 0px;
	background-color: #222;
}

input.search-form__input
{
	box-shadow: 0px 0px 15px 0px #fe9;
}

.button, button
{
	transition: none;
}
}
